clcclearaddpath('../MEA_simulation')%beta = linspace(0, 0.002, 5); % default 0.000975eta = linspace(0, 0.08, 12); % default 0.0389beta = [0.000975]; % default 0.000975%eta = [0.0389]; % default 0.0389tspan = [600000, 660000]; % 60s period after 10 minshow_plot = false;surface = zeros(length(eta), length(beta));freq_all = zeros(1, length(eta) * length(beta));if show_plot    figure(1)endticcounter = 1;for eta_i = 1:length(eta)    for beta_i = 1:length(beta)        [~,~,~,~,freq] = imtiaz_2002d_noTstart_COR_exported(beta(beta_i), eta(eta_i), 8, 1.2, 4, tspan, show_plot);        freq_all(counter) = freq;        % surface(eta_i,beta_i) = freq;        counter = counter + 1;    endendfprintf('Average time per iteration: %f s', toc/(length(eta) * length(beta)));figure(2)t = tiledlayout(1,1,'Padding','none');t.Units = 'inches';t.OuterPosition = [0.25 0.25 3 3];nexttile;plot(eta, freq_all)%title('$\beta$ vs. Freq', 'Interpreter', 'Latex')xlabel('$\eta$', 'Interpreter', 'Latex')ylabel('Freq. (cpm)')f = gcf;exportgraphics(f, 'eta.png', 'Resolution', 300, 'BackgroundColor', 'none')close()% mesh(beta, eta, surface);